import './Navbar.css';
import { NavigatingContext } from './App';
import { useContext } from 'react';

function Navbar() {
  const [navigating, setNavigating] = useContext(NavigatingContext);

  function showSidebar(e) {
    e.preventDefault();
    setNavigating(true);
  }

  return (
    <div className="Navbar">
        <button className="HomeButton">Aadi Kulshrestha</button>
        <button className="SidebarButton" onClick={showSidebar}><i class="fa-solid fa-bars"></i></button>
    </div>
  );
}

export default Navbar;
